import React from "react";

const ProgressBar = ({ value }) => {
  return (
    <div className="w-full bg-lightBg rounded-full h-3">
      <div
        className="bg-secondary h-3 rounded-full"
        style={{ width: `${value}%` }}
      />
    </div>
  );
};

export default ProgressBar;
